const minute=6e4,hour=36e5,day=864e5,year=31536e6,sessionExpireTime=1;var sessionHelper={getItem:function(e){let t=localStorage.getItem(e);if(t){let e=JSON.parse(t),n=Math.round(new Date(e.key).getTime());if(Math.round((new Date).getTime())-n<1)return e.value}return null},setItem:function(e,t){let n={key:new Date,value:t};localStorage.setItem(e,JSON.stringify(n))}};